-- ----------------------------
-- Table structure for `agents`
-- ----------------------------
DROP TABLE IF EXISTS `agents`;
CREATE TABLE `agents` (
  `user_id` int(12) NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `user_name` varchar(30) NOT NULL,
  `password` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL COMMENT '用户邮箱',
  `phone` varchar(20) NOT NULL COMMENT '手机号码',
  `sex` varchar(3) NOT NULL COMMENT '会员性别',
  `user_money` double(50,2) NOT NULL COMMENT '用户总资金',
  `group_id` int(12) NOT NULL COMMENT '组ID 关联agents_group 的agents_id\r\n所有被代理商邀请注册的用户 都默认设为 有佣金客户 即 group_id = 5\r\n',
  `parent_id` int(12) NOT NULL COMMENT '下级代理商ID=对应上级代理商ID, agents.parent_id = agents.user_id',
  `used_bond_money` double(50,2) NOT NULL COMMENT '已用保证金',
  `available_bond_money` double(50,2) NOT NULL COMMENT '可用保证金',
  `cust_vol` varchar(255) NOT NULL COMMENT '当前用户持仓总量/手数',
  `cust_eqy` double(50,2) NOT NULL COMMENT '当前净值',
  `cust_lvg` double NOT NULL COMMENT '当前杠杆',
  `effective_cdt` double(50,2) NOT NULL COMMENT '有效信用',
  `risk_rate` double(50,2) NOT NULL COMMENT '风险率',
  `bond_money` double(50,2) NOT NULL COMMENT '保证金金额',
  `trans_mode` char(2) NOT NULL COMMENT '交易模式，0 佣金模式，1 权益模式',
  `mt4_code` int(12) NOT NULL COMMENT 'MT4用户识别码',
  `mt4_grp` varchar(255) NOT NULL COMMENT '对接MT4组，CS, BS, OS,...',
  `voided` char(3) NOT NULL COMMENT '用户是否有效\r\n-1 无效\r\n1 有效\r\n2 没有同步 MT4',
  `rec_crt_date` datetime NOT NULL COMMENT '创建时间',
  `rec_upd_date` datetime NOT NULL COMMENT '更新时间',
  `rec_crt_user` varchar(30) NOT NULL COMMENT '创建用户',
  `rec_upd_user` varchar(30) NOT NULL COMMENT '更新用户',
  `last_logindate` datetime NOT NULL COMMENT '最后登录时间',
  `Last_landing_time` datetime NOT NULL COMMENT '上次登录时间',
  `user_status` char(3) NOT NULL COMMENT '0 = 未认证，新注册用户统一都是 0\\r\\n 1 = 认证 \\r\\n  2 = 退回审核  -1 = 禁用， 如果禁用 那么 voided =-1 此列也必须更新为  -1',
  `comm_prop` int(3) NOT NULL COMMENT '有无佣金用户返佣百分比',
  `bank_no` varchar(19) NOT NULL COMMENT '银行卡号',
  `bank_no_tmp` varchar(19) NOT NULL COMMENT '审核状态中的银行卡号',
  `bank_class` varchar(255) NOT NULL COMMENT '银行类别',
  `bank_class_tmp` varchar(255) DEFAULT NULL COMMENT '审核状态中的银行类别',
  `bank_img` varchar(255) NOT NULL COMMENT '银行卡正面照（路径）',
  `bank_img_tmp` varchar(255) NOT NULL COMMENT '审核状态是银行卡正面照（路径）',
  `bank_info` varchar(255) NOT NULL COMMENT '开户行详细地址',
  `bank_info_tmp` varchar(255) NOT NULL COMMENT '审核状态中的开户行详细地址',
  `bank_status` char(5) NOT NULL COMMENT '银行卡审核状态 默认 0 审核不通过，1 正在审核中...，2 审核通过，3 银行卡变更， 4 审核不通过',
  `bank_remarks` varchar(255) DEFAULT NULL COMMENT '银行卡审核不通过原因',
  `IDcard_no` varchar(19) NOT NULL COMMENT '身份证号码',
  `IDcard_status` char(5) NOT NULL COMMENT '身份证审核状态 默认 0 没通过审核，1 正在审核中，2 审核通过 ，4 退回',
  `bank_synchro` int(2) NOT NULL DEFAULT '0' COMMENT '用银行卡信息同步到MT4备注 0=未同步 1=已同步',
  `IDcard_img` varchar(255) NOT NULL COMMENT '身份证正面图片',
  `IDcard_negative` varchar(255) NOT NULL COMMENT '身份证反面图片',
  `IDcard_remarks` varchar(255) DEFAULT NULL COMMENT '身份证审核不通过的原因',
  `enable` int(11) NOT NULL COMMENT '客户是否激活 1=激活 0=未激活',
  `enable_readonly` int(11) NOT NULL COMMENT '是否仅允许查询',
  `is_out_money` char(1) NOT NULL COMMENT '是否允许出金  0 = 允许出金， 1 =  不允许出金',
  `is_confirm_agents_lvg` char(1) NOT NULL COMMENT '是否确认代理级别 0 = 未确认，等待确认.  1 = 已经确认代理商级别',
  `country` varchar(255) NOT NULL COMMENT '国家',
  `city` varchar(255) NOT NULL COMMENT '城市',
  `state` varchar(255) NOT NULL COMMENT '州',
  `address` varchar(255) DEFAULT NULL,
  `rights` int(5) NOT NULL DEFAULT '0' COMMENT '权益比例',
  `cycle` int(2) DEFAULT '0' COMMENT '结算周期，1=周结，2=半月结，3=月结',
  `settlement_model` char(5) NOT NULL COMMENT '用户结算模式，1 线上结算，2 线下结算，用于定时计划任务，统计线上结算用户在一周内的权益结算值，\r\n公式: 盈亏 * 代理商权益值 = 权益结算值\r\n盈亏的统计方式参照 仓位总结的盈亏',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`user_id`),
  KEY `INDEX_USER_ID` (`user_id`) USING BTREE,
  KEY `INDEX_PARENT_ID` (`parent_id`) USING BTREE,
  KEY `INDEX_VOIDED` (`voided`) USING BTREE,
  KEY `INDEX_USER_STATUS` (`user_status`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=637128 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

