-- Table structure for `batch_fail_record`
-- ----------------------------
DROP TABLE IF EXISTS `batch_fail_record`;
CREATE TABLE `batch_fail_record` (
  `batch_id` int(12) NOT NULL AUTO_INCREMENT,
  `batch_user_id` int(12) NOT NULL,
  `batch_user_name` varchar(100) NOT NULL,
  `batch_no` varchar(100) NOT NULL COMMENT '每一次入金失败记录的一个批次单号， 一个批次单号对应N个用户ID',
  `batch_type` varchar(100) NOT NULL COMMENT 'P: 代表个人操作\r\nG:代表组别操作\r\nP-PERSOALDEP-SUC-10: 说明 个人成功 入金 $10\r\nP-PERSOALCRE-SUC-10: 说明 个人 成功 信用 $10\r\nG-GROUPDEP-FAIL-10: 说明  组别 入金 失败 $10\r\nG-GROUPCRE-FAIL-10: 说明  组别 信用 失败 $10',
  `batch_ticket` varchar(100) NOT NULL COMMENT '个人操作 入金/信用 成功， 记录MT4返回的订单号, 只针对个人操作',
  `voided` char(3) NOT NULL COMMENT '此列意义不大，参考其他表设计的',
  `rec_crt_user` varchar(30) NOT NULL COMMENT '记录当前单号的是谁创建的',
  `rec_upd_user` varchar(30) NOT NULL,
  `rec_crt_date` datetime NOT NULL,
  `rec_upd_date` datetime NOT NULL,
  PRIMARY KEY (`batch_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

