-- Table structure for `deposit_record_log`
-- ----------------------------
DROP TABLE IF EXISTS `deposit_record_log`;
CREATE TABLE `deposit_record_log` (
  `dep_id` int(12) NOT NULL AUTO_INCREMENT COMMENT '入金订单ID',
  `dep_mt4_id` int(12) NOT NULL COMMENT '对应 mt4_trades.TICKET',
  `dep_status` varchar(30) NOT NULL COMMENT '入金状态\r\n01 : 未支付\r\n02：已支付\r\n05：转入退款\r\n09 : 支付失败\r\n10：订单超时',
  `dep_outChannelNo` varchar(255) NOT NULL,
  `dep_mchId` varchar(50) NOT NULL,
  `dep_channel` varchar(50) NOT NULL,
  `dep_body` varchar(255) NOT NULL,
  `dep_outTrande` varchar(255) NOT NULL,
  `dep_amount` double NOT NULL COMMENT '实际付款金额',
  `dep_act_amount` double NOT NULL COMMENT '实际入金金额',
  `dep_transTime` varchar(255) NOT NULL,
  `voided` char(2) NOT NULL,
  `rec_crt_user` varchar(50) NOT NULL,
  `rec_upd_user` varchar(50) NOT NULL,
  `rec_crt_date` datetime NOT NULL,
  `rec_upd_date` datetime NOT NULL,
  PRIMARY KEY (`dep_id`),
  KEY `index_dep_mt4_id` (`dep_mt4_id`) USING BTREE,
  KEY `index_dep_status` (`dep_status`) USING BTREE,
  KEY `index_dep_amount` (`dep_amount`) USING BTREE,
  KEY `index_dep_act_amount` (`dep_act_amount`) USING BTREE,
  KEY `index_voided` (`voided`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=19499 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

