-- Records of deposit_record_log
-- ----------------------------

-- ----------------------------
-- Table structure for `draw_record_log`
-- ----------------------------
DROP TABLE IF EXISTS `draw_record_log`;
CREATE TABLE `draw_record_log` (
  `record_id` int(12) NOT NULL AUTO_INCREMENT COMMENT '取款申请记录ID',
  `mt4_trades_no` varchar(255) NOT NULL COMMENT '出金成功后MT4返回的订单号填写在这里',
  `user_id` int(12) NOT NULL COMMENT '申请用户ID',
  `user_name` varchar(255) NOT NULL,
  `apply_amount` double(12,2) NOT NULL COMMENT '申请出金金额',
  `act_apply_amount` double(12,2) NOT NULL COMMENT '实际申请金额，如果没有未平仓单则这列记录的是 扣除预设手续费 * 申请金额， 如果有未平仓单，则这列值 == apply_amount',
  `act_pdg_rmb` double(12,2) NOT NULL COMMENT '收取出金RMB手续费',
  `act_draw` double(12,2) NOT NULL COMMENT '实际取款金额，银行卡到账金额',
  `draw_rate` double(10,4) NOT NULL COMMENT '出金汇率',
  `draw_poundage` double(12,2) NOT NULL COMMENT '出金手续费',
  `draw_bank_no` varchar(255) NOT NULL COMMENT '出金银行号码',
  `draw_bank_class` varchar(255) NOT NULL COMMENT '出金银行名',
  `draw_bank_info` varchar(255) NOT NULL COMMENT '开户银行详细地址',
  `apply_status` varchar(10) NOT NULL COMMENT '出金申请状态\r\n0 = 待处理\r\n1 = 正在处理\r\n2 = 已出款\r\n3 = 出款失败， 如果是 3 则  apply_remark备注必填！',
  `apply_remark` varchar(255) DEFAULT NULL COMMENT '出金申请状态失败的时候 【3】 该列必须填写备注',
  `voided` char(3) NOT NULL COMMENT '是否有效，用于删除时 更改为 -1',
  `rec_crt_user` varchar(255) NOT NULL,
  `rec_upd_user` varchar(255) NOT NULL,
  `rec_crt_date` datetime NOT NULL,
  `rec_upd_date` datetime NOT NULL,
  `mt4_return_status` varchar(50) NOT NULL COMMENT '出款失败MT4 返回出金状态 0 =成功 1 = 失败 ',
  PRIMARY KEY (`record_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1044 DEFAULT CHARSET=utf8;

