-- Table structure for `rights_sum`
-- ----------------------------
DROP TABLE IF EXISTS `rights_sum`;
CREATE TABLE `rights_sum` (
  `rights_id` int(12) NOT NULL AUTO_INCREMENT,
  `rights_user_ident` varchar(255) NOT NULL COMMENT '当前记录的唯一标识符, 加密算法是:\r\nstrtoupper(md5(rights_user_id . date(''YmdHis'') . rand(123456, 999999)))',
  `rights_user_id` int(12) NOT NULL COMMENT '权益统计代理商id,关联agents.user_id',
  `rights_user_pid` int(12) NOT NULL COMMENT 'user_id 的 上级 id',
  `rights_user_profit` double(10,2) NOT NULL COMMENT '代理商的盈亏值， 统计 mt4_trades.PROFIT列的值',
  `rights_user_volume` double(10,2) NOT NULL COMMENT '代理商的交易量，统计 mt4_trades.VOLUME',
  `rights_user_value` varchar(50) NOT NULL COMMENT '用户权益值，对应agents.rights列',
  `rights_user_value_diff` varchar(50) NOT NULL COMMENT 'user_id 与 user_pid 两者之间的权益点差',
  `rights_user_cycle` int(2) NOT NULL COMMENT '记录每一条记录的用户结算周期，关联 agents.cycle',
  `rights_mt4_orderId` int(12) NOT NULL COMMENT '权益结算后，将 mt4入金订单号，存在此处',
  `rights_sum_date` varchar(300) NOT NULL COMMENT '权益汇总统计日期范围',
  `rights_sum_status` char(5) NOT NULL COMMENT '权益统计结算状态，是否已经结算 1 等待结算，2 已经结算',
  `rights_sum_shouxufei` double(10,2) NOT NULL COMMENT '手续费',
  `rights_sum_swaps` double(10,2) NOT NULL COMMENT '利息',
  `rights_sum_money` double(10,2) NOT NULL COMMENT '权益统计结算后的应返金额',
  `rights_sum_returnamt` double(10,2) NOT NULL COMMENT '已经返佣的金额',
  `rights_sum_yajin` double(10,2) NOT NULL COMMENT '押金',
  `rights_sum_realamt` double(10,2) NOT NULL COMMENT '权益统计结算后的实返金额',
  `rights_sum_comm` varchar(300) NOT NULL COMMENT '对应rights_sum_tmp.rights_sum_tmpcomm',
  `rights_sum_remarks` varchar(300) NOT NULL COMMENT '记录每一条记录的备注值，用于在入金前先检查mt4表是否已经存在当前记录的入金记录， 防止重复给代理商入金',
  `rights_sum_datetype` varchar(100) NOT NULL COMMENT '数据类型，该表记录主从数据，mainData = 主数据， subData = 从数据',
  `rights_manual_reason` varchar(255) NOT NULL COMMENT '手动结算原因',
  `voided` char(3) NOT NULL,
  `rec_crt_date` datetime NOT NULL,
  `rec_upd_date` datetime NOT NULL,
  `rec_crt_user` varchar(30) NOT NULL,
  `rec_upd_user` varchar(30) NOT NULL,
  PRIMARY KEY (`rights_id`,`rights_user_ident`),
  KEY `rights_user_id` (`rights_user_id`),
  KEY `rights_mt4_orderId` (`rights_mt4_orderId`) USING BTREE,
  KEY `rights_sum_status` (`rights_sum_status`) USING BTREE,
  KEY `rec_upd_date` (`rec_upd_date`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2379 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of rights_sum
-- ----------------------------

-- ----------------------------
-- Table structure for `rights_sum_tmp`
-- ----------------------------
DROP TABLE IF EXISTS `rights_sum_tmp`;
CREATE TABLE `rights_sum_tmp` (
  `rights_sum_tmpid` int(12) NOT NULL AUTO_INCREMENT,
  `rights_sum_tmpuserId` int(12) NOT NULL,
  `rights_sum_tmp_date` varchar(300) NOT NULL,
  `rights_sum_tmpcomm` varchar(300) NOT NULL,
  `rights_sum_tmpstatus` char(5) NOT NULL,
  `voided` char(5) NOT NULL,
  `rec_crt_date` datetime NOT NULL,
  `rec_upd_date` datetime NOT NULL,
  `rec_crt_user` varchar(100) NOT NULL,
  `rec_upd_user` varchar(100) NOT NULL,
  PRIMARY KEY (`rights_sum_tmpid`)
) ENGINE=InnoDB AUTO_INCREMENT=1317 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of rights_sum_tmp
-- ----------------------------

-- ----------------------------
-- Table structure for `role`
-- ----------------------------
DROP TABLE IF EXISTS `role`;
CREATE TABLE `role` (
  `role_id` int(10) NOT NULL AUTO_INCREMENT,
  `username` varchar(50) DEFAULT NULL,
  `desc` text,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `acl` text,
  PRIMARY KEY (`role_id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

