-- ----------------------------
-- Table structure for `symbol_prices`
-- ----------------------------
DROP TABLE IF EXISTS `symbol_prices`;
CREATE TABLE `symbol_prices` (
  `sym_id` int(12) NOT NULL AUTO_INCREMENT,
  `sym_symbol` varchar(16) NOT NULL,
  `sym_time` datetime NOT NULL COMMENT '最后价格的时间',
  `sym_bid` double NOT NULL COMMENT '买价（客户卖价）',
  `sym_ask` double NOT NULL COMMENT '卖价（客户买价）',
  `sym_low` double NOT NULL COMMENT '当前周期（天）最低价',
  `sym_high` double NOT NULL COMMENT '当前周期（天）最高价',
  `sym_direction` int(11) NOT NULL COMMENT '变动方向（0向上，1向下/或反？）',
  `sym_digits` int(11) NOT NULL COMMENT '位数（价格所含小数位数）',
  `sym_spread` int(11) NOT NULL COMMENT '点差（预设点差）',
  `sym_modify_time` datetime NOT NULL COMMENT '更新时间',
  `sym_grp_id` int(12) NOT NULL DEFAULT '0' COMMENT '产品组ID\r\n1. 贵金属\r\n2. 能源\r\n3.外汇\r\n4.指数',
  `voided` char(3) NOT NULL,
  PRIMARY KEY (`sym_id`)
) ENGINE=InnoDB AUTO_INCREMENT=163 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of symbol_prices
-- ----------------------------

-- ----------------------------
-- Table structure for `system_config`
-- ----------------------------
DROP TABLE IF EXISTS `system_config`;
CREATE TABLE `system_config` (
  `sys_id` int(12) NOT NULL AUTO_INCREMENT,
  `sys_draw_risk` int(12) NOT NULL COMMENT '系统预设出金风险率百分比',
  `sys_draw_perc` int(12) NOT NULL COMMENT '系统预设出金百分比',
  `sys_poundage_money` double(5,2) NOT NULL COMMENT '系统预设出金手续费',
  `sys_draw_rate` double(10,4) DEFAULT NULL COMMENT '系统预设取款汇率值',
  `sys_deposit_rate` double(10,4) NOT NULL COMMENT '系统预设存款汇率值',
  `sys_margin_perc` int(12) NOT NULL COMMENT '系统预设保证金风险率',
  `apply_end_date` varchar(30) NOT NULL COMMENT '客户更改交易手续费结束日期',
  `voided` char(3) NOT NULL,
  `rec_crt_user` varchar(255) NOT NULL,
  `rec_upd_user` varchar(255) NOT NULL,
  `rec_crt_date` datetime NOT NULL,
  `rec_upd_date` datetime NOT NULL,
  `trades_start` char(1) NOT NULL,
  `trades_whs_exp_zero` char(1) NOT NULL,
  PRIMARY KEY (`sys_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of system_config
-- ----------------------------

-- ----------------------------
-- Table structure for `system_login_log`
-- ----------------------------
DROP TABLE IF EXISTS `system_login_log`;
CREATE TABLE `system_login_log` (
  `sys_id` int(12) NOT NULL AUTO_INCREMENT,
  `login_id` int(12) NOT NULL,
  `login_id_desc` varchar(255) NOT NULL,
  `login_ip` varchar(100) NOT NULL,
  `login_date` datetime NOT NULL,
  `voided` char(2) NOT NULL,
  PRIMARY KEY (`sys_id`)
) ENGINE=InnoDB AUTO_INCREMENT=26602 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of system_login_log
-- ----------------------------

-- ----------------------------
-- Table structure for `system_param`
-- ----------------------------
DROP TABLE IF EXISTS `system_param`;
CREATE TABLE `system_param` (
  `sys_id` int(12) NOT NULL AUTO_INCREMENT COMMENT '系统变量ID',
  `para_name` varchar(50) NOT NULL,
  `para_data0` varchar(50) DEFAULT NULL COMMENT '变量0 周日',
  `para_data1` varchar(50) DEFAULT NULL COMMENT '变量1,周一允许出金时间范围',
  `para_data2` varchar(50) DEFAULT NULL COMMENT '变量2 周二允许出金时间范围',
  `para_data3` varchar(50) DEFAULT NULL COMMENT '变量3 周三允许出金时间范围',
  `para_data4` varchar(50) DEFAULT NULL COMMENT '变量4 周四允许出金时间范围',
  `para_data5` varchar(50) DEFAULT NULL COMMENT '变量5 周五允许出金时间范围',
  `para_data6` varchar(50) DEFAULT NULL COMMENT '变量6 周六日出金时间规则',
  `para_remark` varchar(255) DEFAULT NULL COMMENT '系统变量描述',
  `voided` char(2) NOT NULL COMMENT '是否有效',
  `rec_crt_user` varchar(255) NOT NULL,
  `rec_upd_user` varchar(255) NOT NULL,
  `rec_crt_date` datetime NOT NULL,
  `rec_upd_date` datetime NOT NULL,
  PRIMARY KEY (`sys_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of system_param
-- ----------------------------

-- ----------------------------
-- Table structure for `trans_apply_log`
-- ----------------------------
DROP TABLE IF EXISTS `trans_apply_log`;
CREATE TABLE `trans_apply_log` (
  `trans_id` int(12) NOT NULL AUTO_INCREMENT,
  `trans_uid` int(12) NOT NULL COMMENT '被申请变更交易类型的ID',
  `trans_type_gid` char(5) NOT NULL COMMENT '交易类型组ID, 关联user_group.group_id',
  `trans_type_name` varchar(100) NOT NULL COMMENT '变更交易类型组名, 关联user_group.user_group_name',
  `trans_apply_uid` int(12) NOT NULL COMMENT '申请变更操作人',
  `trans_apply_uname` varchar(255) NOT NULL COMMENT '申请变更操作人姓名',
  `trans_apply_status` char(3) NOT NULL COMMENT '申请变更操作状态，0=等待变更，1=已确认变更，-1申请变更失败',
  `trans_apply_reason` varchar(255) DEFAULT NULL COMMENT '变更失败原因，当申请状态trans_apply_status = -1 时，此列必须填写值',
  `voided` char(3) NOT NULL COMMENT '默认 1',
  `rec_crt_user` varchar(255) NOT NULL,
  `rec_upd_user` varchar(255) NOT NULL,
  `rec_crt_date` datetime NOT NULL,
  `rec_upd_date` datetime NOT NULL,
  PRIMARY KEY (`trans_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of trans_apply_log
-- ----------------------------

-- ----------------------------
-- Table structure for `user`
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `user_id` int(12) NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `user_name` varchar(30) NOT NULL,
  `password` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL COMMENT '用户邮箱',
  `phone` varchar(20) NOT NULL COMMENT '手机号码',
  `sex` varchar(3) NOT NULL COMMENT '会员性别',
  `user_money` double(50,2) NOT NULL COMMENT '用户总资金',
  `group_id` int(12) NOT NULL COMMENT '组ID 关联agents_group 的agents_id\r\n所有被代理商邀请注册的用户 都默认设为 有佣金客户 即 group_id = 5',
  `parent_id` int(12) NOT NULL COMMENT '下级代理商ID=对应上级代理商ID, agents.parent_id = agents.user_id',
  `used_bond_money` double(50,2) NOT NULL COMMENT '已用保证金',
  `available_bond_money` double(50,2) NOT NULL COMMENT '可用保证金',
  `cust_vol` varchar(255) NOT NULL COMMENT '当前用户持仓总量/手数',
  `cust_lvg` double NOT NULL COMMENT '当前杠杆',
  `cust_eqy` double(50,2) NOT NULL COMMENT '当前净值',
  `effective_cdt` double(50,2) NOT NULL COMMENT '有效信用',
  `risk_rate` double(50,2) NOT NULL COMMENT '风险率',
  `bond_money` double(50,2) NOT NULL COMMENT '保证金金额',
  `trans_mode` char(2) NOT NULL COMMENT '交易模式，0 佣金模式，1 权益模式',
  `mt4_code` int(12) NOT NULL COMMENT 'MT4用户识别码',
  `mt4_grp` varchar(255) NOT NULL COMMENT '对接MT4组，CS, BS, OS,...',
  `voided` char(3) NOT NULL COMMENT '用户是否有效\r\n-1 无效\r\n1 有效\r\n2 没有同步 MT4',
  `rec_crt_date` datetime NOT NULL COMMENT '创建时间',
  `rec_upd_date` datetime NOT NULL COMMENT '更新时间',
  `rec_crt_user` varchar(30) NOT NULL COMMENT '创建用户',
  `rec_upd_user` varchar(30) NOT NULL COMMENT '更新用户',
  `last_logindate` datetime NOT NULL COMMENT '最后登录时间',
  `Last_landing_time` datetime NOT NULL COMMENT '上次登陆时间',
  `user_status` char(3) NOT NULL COMMENT '0 = 未认证，新注册用户统一都是 0\\r\\n 1 = 认证 \\r\\n  2 = 退回审核  -1 = 禁用， 如果禁用 那么 voided =-1 此列也必须更新为  -1',
  `comm_prop` int(3) NOT NULL COMMENT '有无佣金用户返佣百分比',
  `bank_no` varchar(19) NOT NULL COMMENT '银行卡号',
  `bank_no_tmp` varchar(19) NOT NULL COMMENT '审核状态中的银行卡号',
  `bank_class` varchar(255) NOT NULL COMMENT '银行类别',
  `bank_class_tmp` varchar(255) DEFAULT NULL COMMENT '审核状态中的银行类别',
  `bank_img` varchar(255) NOT NULL COMMENT '银行卡正面照（路径）',
  `bank_img_tmp` varchar(255) NOT NULL COMMENT '审核状态是银行卡正面照（路径）',
  `bank_info` varchar(255) NOT NULL COMMENT '开户行详细地址',
  `bank_info_tmp` varchar(255) NOT NULL COMMENT '审核状态中的开户行详细地址',
  `bank_status` char(5) NOT NULL COMMENT '银行卡审核状态 默认 0 审核不通过，1 正在审核中...，2 审核通过，3 银行卡变更， 4 审核不通过',
  `bank_remarks` varchar(255) DEFAULT NULL COMMENT '银行卡审核不通过原因',
  `IDcard_no` varchar(19) NOT NULL COMMENT '身份证号码',
  `IDcard_status` char(5) NOT NULL COMMENT '身份证审核状态 默认 0 没通过审核，1 正在审核中，2 审核通过 ，4 退回',
  `bank_synchro` int(2) NOT NULL DEFAULT '0' COMMENT '用银行卡信息同步到MT4备注 0=未同步 1=已同步',
  `IDcard_img` varchar(255) NOT NULL COMMENT '身份证正面图片',
  `IDcard_negative` varchar(255) NOT NULL COMMENT '身份证反面图片',
  `IDcard_remarks` varchar(255) DEFAULT NULL COMMENT '身份证审核不通过的原因 0=不是本人 1=图片不清晰',
  `enable` int(11) NOT NULL COMMENT '客户是否激活',
  `enable_readonly` int(11) NOT NULL COMMENT '是否仅允许查询',
  `is_out_money` char(1) NOT NULL COMMENT '是否允许出金  0 = 允许出金， 1 =  不允许出金',
  `is_confirm_agents_lvg` char(1) NOT NULL COMMENT '是否确认代理级别 0 = 未确认，等待确认.  1 = 已经确认代理商级别',
  `country` varchar(255) NOT NULL COMMENT '国家',
  `city` varchar(255) NOT NULL COMMENT '城市',
  `state` varchar(255) NOT NULL COMMENT '州',
  `address` varchar(255) DEFAULT NULL,
  `rights` int(5) NOT NULL DEFAULT '0' COMMENT '权益',
  `cycle` int(2) DEFAULT '0' COMMENT '结算周期，1=周结，2=半月结，3=月结',
  `settlement_model` char(5) NOT NULL COMMENT '该列只适用于 代理商，这里添加此列只为了两个表统一字段数\r\n用户结算模式，1 线上结算，2 线下结算，用于定时计划任务，统计线上结算用户在一周内的权益结算值，\r\n公式: 盈亏 * 代理商权益值 = 权益结算值\r\n盈亏的统计方式参照 仓位总结的盈亏',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`user_id`),
  KEY `INDEX_USER_ID` (`user_id`) USING BTREE,
  KEY `INDEX_PARENT_ID` (`parent_id`) USING BTREE,
  KEY `INDEX_VOIDED` (`voided`) USING BTREE,
  KEY `INDEX_USER_STATUS` (`user_status`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=40370428 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
-- Records of user
-- ----------------------------

-- ----------------------------
-- Table structure for `user_group`
-- ----------------------------
DROP TABLE IF EXISTS `user_group`;
CREATE TABLE `user_group` (
  `user_group_id` int(12) NOT NULL AUTO_INCREMENT COMMENT '用户组别ID',
  `user_group_name` varchar(255) NOT NULL COMMENT '用户组别名',
  `user_grup_radix` double(8,2) NOT NULL COMMENT '用户组标准基数',
  `mt4_grpId` varchar(100) NOT NULL COMMENT '对应MT4插件group_id',
  `group_id` char(1) NOT NULL COMMENT '用户类型\r\n1 ： 有佣金\r\n0 ： 无佣金\r\n\r\n在计算返佣时 判定次用户 是 1 还是 0\r\n   A: 1  有佣金模式，5+5 成本 100 手续费 50\r\n保持现有计算方式\r\n   B:  0 无佣金模式， 5+0 成本100 手续费 0\r\n返佣结果 再 减去 50\r\n',
  `is_default` char(1) NOT NULL COMMENT '是否设为默认组 1 是， 0 不是',
  `voided` char(3) NOT NULL COMMENT ' 1 有效 0 无效',
  `rec_crt_user` varchar(255) NOT NULL COMMENT '创建用户',
  `rec_upd_user` varchar(255) NOT NULL COMMENT '更新用户',
  `rec_crt_date` datetime NOT NULL COMMENT '创建时间',
  `rec_upd_date` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`user_group_id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of user_group
-- ----------------------------

-- ----------------------------
-- Table structure for `user_img`
-- ----------------------------
DROP TABLE IF EXISTS `user_img`;
CREATE TABLE `user_img` (
  `img_id` int(12) NOT NULL AUTO_INCREMENT,
  `user_id` int(12) NOT NULL,
  `img_type` char(5) NOT NULL COMMENT '图片类型，1=header(用户头像)， 2=身份证， 3=银行卡',
  `img_idcard01_path` varchar(200) DEFAULT NULL COMMENT '身份证正面图片路径',
  `img_idcard02_path` varchar(200) DEFAULT NULL COMMENT '身份证正面图片路径',
  `img_header_path` varchar(200) DEFAULT NULL,
  `img_bank_path` varchar(200) DEFAULT NULL,
  `img_idcard_status` char(5) NOT NULL COMMENT '身份证审核状态 1 正在审核中，2 审核通过 ，3 审核不通过'',',
  `img_bank_status` char(5) NOT NULL COMMENT '''银行卡审核状态1 正在审核中...，2 审核通过，3 银行卡变更''',
  `voided` char(5) NOT NULL COMMENT '记录是否有效 默认1， 2 无效',
  `rec_crt_date` datetime NOT NULL,
  `rec_upd_date` datetime NOT NULL,
  `rec_crt_user` varchar(200) NOT NULL,
  `rec_upd_user` varchar(200) NOT NULL,
  PRIMARY KEY (`img_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1030 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of user_img
-- ----------------------------

-- ----------------------------
-- Table structure for `user_trades`
-- ----------------------------
DROP TABLE IF EXISTS `user_trades`;
CREATE TABLE `user_trades` (
  `trades_id` int(12) NOT NULL AUTO_INCREMENT COMMENT '交易记录ID',
  `user_id` int(12) NOT NULL COMMENT '客户帐号',
  `ticket` int(11) NOT NULL COMMENT '交易单号',
  `symbol` char(16) NOT NULL COMMENT '交易产品/符号',
  `digits` int(11) NOT NULL COMMENT '产品报价小数位数',
  `cmd` int(11) NOT NULL COMMENT '交易类型',
  `volume` int(11) NOT NULL COMMENT '交易量',
  `open_time` datetime NOT NULL COMMENT '开仓时间',
  `open_price` double NOT NULL COMMENT '开仓价格',
  `stop_loss` double NOT NULL COMMENT '止损（stop loss）价格（如有',
  `take_profit` double NOT NULL COMMENT '止赢（take profit）价格（如有）',
  `close_time` datetime NOT NULL COMMENT '平仓时间',
  `expiration` datetime NOT NULL COMMENT '有效期 （cmd 7 有数值 其他无限）',
  `reason` int(11) NOT NULL DEFAULT '0' COMMENT '交易单号',
  `conv_rate1` double NOT NULL COMMENT '开仓兑换汇率',
  `conv_rate2` double NOT NULL COMMENT '平仓兑换汇率',
  `commission` double NOT NULL COMMENT '手续费',
  `commission_agent` double NOT NULL COMMENT '代理手续费',
  `swaps` double NOT NULL COMMENT '隔夜',
  `close_price` double NOT NULL COMMENT '平仓价格',
  `profit` double NOT NULL COMMENT '盈亏',
  `taxes` double NOT NULL COMMENT '税',
  `comment` char(32) NOT NULL COMMENT '备注',
  `internal_id` int(11) NOT NULL COMMENT '内部ID',
  `margin_rate` double NOT NULL COMMENT '保证金兑换汇率',
  `timestamp` int(11) NOT NULL COMMENT '时间戳',
  `magic` int(11) NOT NULL DEFAULT '0',
  `gw_volume` int(11) NOT NULL DEFAULT '0',
  `gw_open_price` int(11) NOT NULL DEFAULT '0',
  `gw_close_price` int(11) NOT NULL DEFAULT '0',
  `modify_time` datetime NOT NULL COMMENT '记录修改时间',
  `voided` char(3) NOT NULL COMMENT '0 未结算等待结算 1 已经结算',
  `rec_comp_date` datetime DEFAULT NULL COMMENT '返佣记录完成时间',
  PRIMARY KEY (`trades_id`),
  KEY `index_login` (`user_id`),
  KEY `index_cmd` (`cmd`),
  KEY `index_opentime` (`open_time`),
  KEY `index_closetime` (`close_time`),
  KEY `index_stamp` (`timestamp`)
) ENGINE=InnoDB AUTO_INCREMENT=38936 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
-- Records of user_trades
-- ----------------------------

-- ----------------------------
-- Table structure for `user_trades_info`
-- ----------------------------
DROP TABLE IF EXISTS `user_trades_info`;
CREATE TABLE `user_trades_info` (
  `trades_id` int(12) NOT NULL AUTO_INCREMENT COMMENT '交易记录ID',
  `user_id` int(12) NOT NULL COMMENT '客户帐号',
  `ticket` int(11) NOT NULL COMMENT '交易单号',
  `symbol` char(16) NOT NULL COMMENT '交易产品/符号',
  `digits` int(11) NOT NULL COMMENT '产品报价小数位数',
  `cmd` int(11) NOT NULL COMMENT '交易类型',
  `volume` int(11) NOT NULL COMMENT '交易量',
  `open_time` datetime NOT NULL COMMENT '开仓时间',
  `open_price` double NOT NULL COMMENT '开仓价格',
  `stop_loss` double NOT NULL COMMENT '止损（stop loss）价格（如有',
  `take_profit` double NOT NULL COMMENT '止赢（take profit）价格（如有）',
  `close_time` datetime NOT NULL COMMENT '平仓时间',
  `expiration` datetime NOT NULL COMMENT '有效期 （cmd 7 有数值 其他无限）',
  `reason` int(11) NOT NULL DEFAULT '0' COMMENT '交易单号',
  `conv_rate1` double NOT NULL COMMENT '开仓兑换汇率',
  `conv_rate2` double NOT NULL COMMENT '平仓兑换汇率',
  `commission` double NOT NULL COMMENT '手续费',
  `commission_agent` double NOT NULL COMMENT '代理手续费',
  `swaps` double NOT NULL COMMENT '隔夜',
  `close_price` double NOT NULL COMMENT '平仓价格',
  `profit` double NOT NULL COMMENT '盈亏',
  `taxes` double NOT NULL COMMENT '税',
  `comment` char(32) NOT NULL COMMENT '备注',
  `internal_id` int(11) NOT NULL COMMENT '内部ID',
  `margin_rate` double NOT NULL COMMENT '保证金兑换汇率',
  `timestamp` int(11) NOT NULL COMMENT '时间戳',
  `magic` int(11) NOT NULL DEFAULT '0',
  `gw_volume` int(11) NOT NULL DEFAULT '0',
  `gw_open_price` int(11) NOT NULL DEFAULT '0',
  `gw_close_price` int(11) NOT NULL DEFAULT '0',
  `modify_time` datetime NOT NULL COMMENT '记录修改时间',
  `voided` char(3) NOT NULL COMMENT '0 未结算等待结算 1 已经结算',
  `rec_comp_date` datetime DEFAULT NULL COMMENT '返佣记录完成时间',
  PRIMARY KEY (`trades_id`),
  KEY `index_login` (`user_id`),
  KEY `index_cmd` (`cmd`),
  KEY `index_opentime` (`open_time`),
  KEY `index_closetime` (`close_time`),
  KEY `index_stamp` (`timestamp`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
-- Records of user_trades_info
-- ----------------------------

