-- Table structure for `whs_exp_zero`
-- ----------------------------
DROP TABLE IF EXISTS `whs_exp_zero`;
CREATE TABLE `whs_exp_zero` (
  `wez_id` int(12) NOT NULL AUTO_INCREMENT,
  `wez_userid` int(12) NOT NULL,
  `wez_username` varchar(30) NOT NULL,
  `wez_userbal` double(50,2) NOT NULL COMMENT '爆仓清零时的余额',
  `wez_usercrt` double(50,2) NOT NULL COMMENT '爆仓清零时的信用额',
  `voided` char(2) NOT NULL,
  `rec_crt_user` varchar(30) NOT NULL,
  `rec_upd_user` varchar(30) NOT NULL,
  `rec_crt_date` datetime NOT NULL,
  `rec_upd_date` datetime NOT NULL,
  PRIMARY KEY (`wez_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

