INSERT INTO `newslist` VALUES ('3', 'admin', '沪深300合约交割公告', '<p>尊敬的客户您好:</p><p><br/></p><p>沪深300本月合约将在11月16日（北京时间）到期，我们将在下周三即11月14日15：00（北京时间）休市后，开始切换成下个月份的合约，切换后旧合约将停止报价，请各交易客户务必在11月14日15：00（北京时间）之前对持仓单全部进行平仓处理。</p>', '1', '1', 'admin', 'admin', '2018-11-09 15:52:11', '2018-11-09 15:52:11');
